import React from 'react';
import { Checkbox } from 'antd';
import {  Col, Row } from 'antd';

const CheckboxGroup = Checkbox.Group;
class Q extends React.Component {
    render(){
        function onChange(checkedValues) {
            console.log('checked = ', checkedValues);
          }

          const Options = ['HTML', 'Pear', 'Orange'];
        return(
            <div>
    <Row>
        <Col  style={{float: 'right'}}><CheckboxGroup options={plainOptions} defaultValue={['MongoDB']} onChange={onChange} />
    <br />
    <br />
    <CheckboxGroup options={plOptions} defaultValue={['Pear']} onChange={onChange} />
    <br />
    <br />
    <CheckboxGroup
      options={plainOptions}

      defaultValue={['Apple']}
      onChange={onChange}
    /></Col>
    </Row>
    </div>
        )
    }
}

export default Q;
